import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
    const blogOjbArr = [{
      title: 'Test',
      desc: 'Testtestetst'
    },
    {
      title: 'Test1',
      desc: 'Testtestetst'
    },
    {
      title: 'Test2',
      desc: 'Testtestetst'
    }]

    const blogCard = blogOjbArr.map((item, pos)=>{
      return(
        <div key={pos}>
        <h3>{item.title}</h3>
        <p>{item.desc}</p>
      </div>
      )
    });
  return (
    <div className="App">
      <div>
        {blogCard}
      </div>
    </div>
  );
}

export default App;
